import{_ as e,o as a,c as i,e as o}from"./chunks/framework.7WwFwkJk.js";const k=JSON.parse('{"title":"Седов и Ко","description":"Мебельная мастерская и столярный коворкинг","frontmatter":{"title":"Седов и Ко","description":"Мебельная мастерская и столярный коворкинг","date":"2016-12-22","logoe":"LOGO512.png","url":"https://sedoviko.ru","email":"info@sedoviko.ru","tel":"+7 (903) 328-45-20","instagram":"sedoviko","youtube-channel":"sedovikoru","facebook":"sedoviko","vk":"sedovikoru","address":"Полимерная 7 с2","place":"м. Новогиреево","city":"г. Москва","coord":[55.74698062594055,37.798770241002295],"status":"open","cover":"JN5r-Rbd2O4.jpg"},"headers":[],"relativePath":"workshop/archive/sedov-i-ko/index.md","filePath":"workshop/archive/sedov-i-ko/index.md"}'),l={name:"workshop/archive/sedov-i-ko/index.md"},t=o('<h2 id="«седов-и-ко»-—-мебельная-мастерская-пункт-проката-инструмента-и-столярныи-коворкинг" tabindex="-1">«Седов и Ко» — мебельная мастерская, пункт проката инструмента и столярный коворкинг. <a class="header-anchor" href="#«седов-и-ко»-—-мебельная-мастерская-пункт-проката-инструмента-и-столярныи-коворкинг" aria-label="Permalink to &quot;«Седов и Ко» — мебельная мастерская, пункт проката инструмента и столярный коворкинг.&quot;">​</a></h2><p>Мы делаем современную мебель и различные предметы из фанеры, бетона, стекла, эпоксидной смолы и других материалов.</p><h2 id="коворкинг-для-мастеров" tabindex="-1">Коворкинг для мастеров <a class="header-anchor" href="#коворкинг-для-мастеров" aria-label="Permalink to &quot;Коворкинг для мастеров&quot;">​</a></h2><p>Наша мастерская открытая. Мы предоставляем услуги ремесленного коворкинга для мастеров.</p><p>Мы ждем у себя других мастеров. Если у вас есть творческие замыслы, но нет мастерской, где их реализовать, приходите на часок, поработайте один день или приобретите абонемент на месяц. В вашем распоряжении будет богатый набор инструментов, камера хранения, магазин расходных материалов и <strong>прокат инструмента</strong>. Постоянным резидентам мы можем предложить в аренду специализированный инвентарь и закрепленное место. Изделия единомышленников мы поможем реализовать через собственный интернет-магазин.</p><p>500 р./день всё включено (пользование ручным, электрическим и режущим инструментом, верстаками). Расходные материалы предоставляются по договорной цене. Имеются торцовочная пила, погружная циркулярная пила, распиловочный станок, фрезер, плоская и  ленточная шлифмашины, разнообразные кондукторы, краскопульт, струбцины, сверла, фрезы, угольники, штангенциркули и другие приспособления для столярных работ.</p><h2 id="пункт-проката-инструментов" tabindex="-1">Пункт проката инструментов <a class="header-anchor" href="#пункт-проката-инструментов" aria-label="Permalink to &quot;Пункт проката инструментов&quot;">​</a></h2><p>Аренда инструментов для любителей и профессионалов. Предлагаем арендовать: перфоратор, отбойный молоток, буры, пики, коронки, долота, краскопульт, торцовка, лобзик, прожектор, распиловочный станок, погружная пила, лазерный нивелир, лазерный дальномер, строительный пылесос, болгарки и УШМ, шуруповерт, дрель и другой инструмент. К инструментам прилагается базовая оснастка. На время пользования инструментом оставляется денежный залог.</p><p>Мы бесплатно доставляем инструмент по Саратову. Доставка в Энгельс и пригороды Саратова платная. Бронирование инструмента на сайте и по телефону.</p><h3 id="правила-проката" tabindex="-1">Правила проката <a class="header-anchor" href="#правила-проката" aria-label="Permalink to &quot;Правила проката&quot;">​</a></h3><ul><li>Арендованный инструмент мы бесплатно доставим на ваш объект в Саратове.</li><li>Оформление документов и оплата аренды и (или) залога производится при получении инструмента. Арендатору необходимо обеспечить пропуск на объект и организовать разгрузку (погрузку) оборудования собственными силами.</li><li>Обязательно проводится предварительный инструктаж по правилам безопасной эксплуатации. В присутствии клиента выполняется пробный запуск оборудования в соответствии с инструкцией. Арендатор имеет право вписать в Акт приема/передачи все выявленные недостатки.</li></ul><h5 id="необходимые-документы" tabindex="-1">Необходимые документы <a class="header-anchor" href="#необходимые-документы" aria-label="Permalink to &quot;Необходимые документы&quot;">​</a></h5><ul><li>Оборудование выдается при предоставлении паспорта с информацией о месте прописки или регистрации. Наличие реквизитов Арендатора является обязательным пунктом в договоре.Оплата. Оборудование можно получить сразу после внесения суммы установленного залога и полной арендной платы за весь заявленный период.</li><li>Продление срока аренды возможно. Необходимо заранее предупредить Арендодателя по телефону и оплатить новый период любым согласованным с представителем компании способом.</li><li>Предусмотрены различные варианты оплаты — от пластиковой карты в Интернете до выезда сотрудника компании на объект.</li></ul><h5 id="условия-возврата-и-окончательных-расчетов" tabindex="-1">Условия возврата и окончательных расчетов <a class="header-anchor" href="#условия-возврата-и-окончательных-расчетов" aria-label="Permalink to &quot;Условия возврата и окончательных расчетов&quot;">​</a></h5><ul><li>Период аренды рассчитывается строго по времени между получением и возвратом оборудования на склад и не зависит от погоды и времени в эксплуатации. Арендатору по окончании заявленного срока необходимо позвонить и заказать вывоз оборудования с объекта.</li><li>При приеме инструмента после аренды проводится проверка на комплектность и работоспособность, после осмотра осуществляется окончательный расчет. Сумма возврата денежных средств Заказчику определяется по формуле:</li></ul><p>Сумма возврата (доплаты) = предоплата (залог + аренда) – удержания – сумма фактической стоимости аренды (определяется по фактическому периоду).</p><ul><li>Удержания проводятся строго в соответствии с договором, величина зависит от состояния техники и инструмента составляет в случаях: <ul><li>сдачи грязного оборудования – 500 руб.;</li><li>обнаружения неисправностей и некомплекта во время проверки – из суммы возврата вычитается стоимость ремонта и восстановления.</li></ul></li></ul><p><strong>Отказ от возврата арендованного инструмента приравнивается к его покупке.</strong></p><ul><li>Обязательно необходимо предупредить сотрудника компании любым удобным способом в случае возникновения форс-мажорных обстоятельств: <ul><li>отъезд с оборудованием и инструментом во время периода аренды;</li><li>смена номера или потеря телефона.</li></ul></li></ul><p>Это позволит сохранить долгосрочные доверительные отношения, избежать вывоза оборудования с объекта согласно условиям Договора и наложения штрафов.</p>',20),r=[t];function s(n,d,h,c,u,p){return a(),i("div",null,r)}const m=e(l,[["render",s]]);export{k as __pageData,m as default};
